import React from 'react';
import './SmallCard.css';

export function SmallCard(props){
    return (
        <div className="container">
            <img src={ props.icone } className="meuIcone" alt=""/>
            <p className="tipoDado">{ props.titulo }</p>
            <p> { props.texto } </p>
        </div>
    )
}
